        int maxProduct = 0;
        dfs(root, sum, maxProduct);
        return maxProduct;
    }

    void dfs(TreeNode* root, int& sum, int& maxProduct) {
        if (!root) return;
        sum += root->val;
        dfs(root->left, sum, maxProduct);
        dfs(root->right, sum, maxProduct);
