/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode(int x) : val(x), left(NULL), right(NULL) {}
 * };
 */
class Solution {
public:
    int maxLevelSum(TreeNode* root) {
        int maxSum = root->val;
        int maxLevel = 1;
        queue<TreeNode*> q;
        q.push(root);
        int currLevel = 1;
        int currSum = 0;
        while(!q.empty()) {
            int size = q.size();
            currSum = 0;
            for(int i = 0; i < size; i++) {
                TreeNode* curr = q.front();
                q.pop();
                currSum += curr->val;
                if(curr->left) {
                    q.push(curr->left);
                }
                if(curr->right) {
                    q.push(curr->right);
                }
            }
            if(currSum > maxSum) {
                maxSum = currSum;
                maxLevel = currLevel;
            }
            currLevel++;
        }
        return maxLevel;
    }
};

